import Layout from '../Components/layout';
import {Button} from 'react-bootstrap';

const About = ()=> (
    <Layout>
   
    <div>
       
       <h1> About SpaceX </h1>
    <p> It would help users list and browse all launches by SpaceX program.</p>
    <Button>Click Me!</Button>
    </div>
  
    </Layout>
);

export default About;
